import React, { useEffect, useState } from 'react';
import { Users } from './components/user_list'
import './App.css';

function App() {
  const [mode, setMode] = useState("default")
  const [content, setContent] = useState(<Users />)

  useEffect(() => {
    if (mode == "default") {
      setContent(<Users />);
    } else if (mode == "create-user") {
      setContent(<h1>Not implemented</h1>);
    }
  }, [mode])

  function DefaultMode() {
    console.log("setting mode to default");
    setMode("default");
  }

  function CreateUserMode() {
    console.log("setting mode to create-user");
    setMode("create-user");
  }

  function DeleteUserMode() {
    console.log("setting mode to create-user");
    setMode("delete-user");
  }

  return (
    <div className="App">
      <ul className='menu-bar'>
        <li><a href='#' onClick={DefaultMode}>Show</a></li>
        <li><a href='#' onClick={CreateUserMode}>Create</a></li>
        <li><a href='#'>Delete User</a></li>
      </ul>
      {content}
    </div>
  );
}

export default App;
